  console.log('staffNames ', staffNames)
  return(
    <div className = 'search-contain'>
      <form>
        <label>
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  )
}

export default DirectorySearchBar
